import React from 'react';
import './Main.css';
import Pic from '../quizpic.png';
import Pic2 from '../Contract.png';
import Pic3 from '../OverTime.jpg';
import Logo1 from '../LinkedIn2.png';
import Logo2 from '../Github2.png';
import Logo3 from '../mail2.png';


export default (props) =>{

    const HoverIn = (e) => {};
    const HoverOut = (e) => {};


    return(
        <div className="container">
            <div className="col-10 offset-1 text-center Kevin">
                <h1 id="main"><span style={{color:"red", fontWeight:"bold"}}>Hey</span> I'm Kevin</h1>
                <p> I am a Full-Stack web developer with experience working in Python/Django, MERN, and C#/Asp.net
                </p>
                My Story:
                <p> After leaving my hometown of Las <span style={{color:"red", fontWeight:"bold"}}>Vegas</span> to join the Air Force, I began my life journey in Alaska, working in transportation. I spent the next 
                    four years there with one deployment to Qatar. When my military contract was over, I decided to continue my 
                    operations career in Seattle. Also, during this time, I finished my Associate's degree in Transportation and my <span style={{color:"red", fontWeight:"bold"}}>Bachelor's </span> 
                    in Business/International finance. 
                </p>
                <p> My <span style={{color:"red", fontWeight:"bold"}}>entire</span> life, I've loved working with computers, creating awesome visions out of nothing, automating & organizing operations, 
                    and creating my own works art. I realized that I wasn't happy in my field of work, and relocating to Seattle
                    helped me discover the world of computer programming. The Bellevue based school, Coding Dojo, has taught and prepared me to 
                    become a self-suficient, savvy, full-stack developer ready for anything thrown my way!
                </p>
                <h4>Some of my <span style={{color:"red", fontWeight:"bold"}}>work:</span></h4>
            </div>
            <div className="row justify-content-between mt-2">
                <div className="col-3 text-center proj1">
                    <p> <a href="http://ec2-18-224-17-120.us-east-2.compute.amazonaws.com" style={{color:"white"}}>Quiz of Death (MERN)</a> </p>
                    <a href="http://ec2-18-224-17-120.us-east-2.compute.amazonaws.com"><img className="col-10" src={Pic} alt="Quiz App" style={{height:"80%"}}/></a> 
                </div>
                <div className="col-3 text-center proj2">
                    <p><a href="https://github.com/John-W-Stevens/contract_manager" style={{color:"white"}}> Contract Manager (Python) </a></p>
                    <a href="https://github.com/John-W-Stevens/contract_manager" ><img className="col-12" src={Pic2} alt="Contract Manager" style={{height:"80%"}}
                        onMouseEnter={(e) => HoverIn(e.target.style.height = '82%', e.target.style.width ='100%')} 
                        onMouseLeave={(e) => HoverOut(e.target.style.height = '80%', e.target.style.width ='auto')}
                    /></a> 
                </div>
                    <div className="col-3 text-center proj3">
                    <p><a href="/" style={{color:"white"}}> The Differenciator (C#) </a> </p>
                    <a href="/"><img className="col-12" src={Pic3} alt="Differenciator" style={{height:"80%"}}
                        onMouseEnter={(e) => HoverIn(e.target.style.height = '82%', e.target.style.width ='100%')} 
                        onMouseLeave={(e) => HoverOut(e.target.style.height = '80%', e.target.style.width ='auto')}
                    /></a> 
                </div>
            </div>
            <div className="col-12 offset-5 row mt-5 text-center links">
                <div>
                    <a href="https://www.linkedin.com/in/kevin-chancey-a736169b/">
                        <img src={Logo1} style={{height:"3%"}} 
                            onMouseEnter={(e) => HoverIn(e.target.style.height = '32px')} 
                            onMouseLeave={(e) => HoverOut(e.target.style.height = '30px')}>
                        </img>
                    </a>
                </div>
                <div class="col-1">
                    <a href="https://github.com/R2DEV0">
                        <img src={Logo2} style={{height:"30px"}}
                            onMouseEnter={(e) => HoverIn(e.target.style.height = '32px')} 
                            onMouseLeave={(e) => HoverOut(e.target.style.height = '30px')}>
                        </img>
                    </a>
                </div>
                <div>
                    <a href="mailto:r2devo@gmail.com">
                        <img src={Logo3} style={{height:"30px", borderRadius:"5px"}}
                            onMouseEnter={(e) => HoverIn(e.target.style.height = '32px')} 
                            onMouseLeave={(e) => HoverOut(e.target.style.height = '30px')}>
                        </img>
                    </a>
                </div>
            </div>
        </div>
    )
};
